/*
 * Transliteration database layout:
 *
 *    0x00        // NUL
 *    0x00        // NUL
 *    {
 *        <ch>    // The character that is being transliterated (encoded as UTF-8; many not be empty)
 *        0x00    // NUL
 *        {
 *            <repl>  // Replacement string (encoded as UTF-8; may be empty only iff this is the only replacement)
 *            0x00    // NUL
 *        } [Repeat for every possible replacement]
 *        0x00    // NUL
 *    } [Repeat for every entry, sorted by the unicode ordinal represented by <ch>]
 *
 * Because entries are separated by \0\0, it's always possible to locate the start
 * or  end of any given entry by looking for the nearest sequence of 2 consecutive
 * NUL characters. Note  that when <repl>  is empty, there  are 3 consecutive  NUL
 * characters, though there is no situation where  it would be more than that.  As
 * such, when 3 are  encountered in a row,  the first is the  NUL after <ch>,  and
 * the second and third are the NULs after <repl> (which happens to be empty).
 *
 * Because the entire database is sorted by the unicode value of <ch>, this makes
 * it possible to use binary search for locating the replacement strings for  any
 * given unicode character in O(log2(N)), where N = sizeof(libiconv_translit_db).
 *
 */


/*[[[deemon (printTranslitDatabase from .iconvdata.transliterate)();]]]*/
